import React, { useState } from 'react';
import { Home, Package, ShoppingCart, Users, Menu, Truck, FileText, ChefHat, Apple, BarChart3, Settings, Bell, User } from 'lucide-react';

// Composant AdminNavbar
const AdminNavbar = ({ currentPage, onNavigate }) => {
  const menuItems = [
    { id: 'dashboard', label: 'Dashboard', icon: Home },
    { id: 'abonnements', label: 'Abonnements', icon: Bell },
    { id: 'stocks', label: 'Stocks', icon: Package },
    { id: 'commandes', label: 'Commandes', icon: ShoppingCart },
    { id: 'clients', label: 'Clients', icon: Users },
    { id: 'menu', label: 'Menu', icon: Menu },
    { id: 'livraisons', label: 'Livraisons', icon: Truck },
    { id: 'facturation', label: 'Facturation', icon: FileText },
    { id: 'kitchen', label: 'Cuisine', icon: ChefHat },
    { id: 'ingredients', label: 'Ingrédients', icon: Apple },
    { id: 'statistics', label: 'Statistiques', icon: BarChart3 },
    { id: 'settings', label: 'Paramètres', icon: Settings }
  ];

  return (
    <nav className="bg-white shadow-lg border-b">
      <div className="max-w-7xl mx-auto px-4">
        <div className="flex justify-between items-center h-16">
          <div className="flex items-center space-x-8">
            <div className="flex-shrink-0">
              <h1 className="text-xl font-bold text-gray-800">Admin Dashboard</h1>
            </div>
            <div className="hidden md:block">
              <div className="ml-10 flex items-baseline space-x-4">
                {menuItems.slice(0, 6).map((item) => {
                  const Icon = item.icon;
                  return (
                    <button
                      key={item.id}
                      onClick={() => onNavigate(item.id)}
                      className={`px-3 py-2 rounded-md text-sm font-medium flex items-center space-x-1 transition-colors ${
                        currentPage === item.id
                          ? 'bg-blue-100 text-blue-700'
                          : 'text-gray-600 hover:text-gray-900 hover:bg-gray-100'
                      }`}
                    >
                      <Icon size={16} />
                      <span>{item.label}</span>
                    </button>
                  );
                })}
              </div>
            </div>
          </div>
          <div className="flex items-center space-x-4">
            <button className="p-2 rounded-full text-gray-600 hover:text-gray-900 hover:bg-gray-100">
              <Bell size={20} />
            </button>
            <button className="p-2 rounded-full text-gray-600 hover:text-gray-900 hover:bg-gray-100">
              <User size={20} />
            </button>
          </div>
        </div>
      </div>
      
      {/* Menu mobile */}
      <div className="md:hidden">
        <div className="px-2 pt-2 pb-3 space-y-1 bg-gray-50">
          {menuItems.map((item) => {
            const Icon = item.icon;
            return (
              <button
                key={item.id}
                onClick={() => onNavigate(item.id)}
                className={`w-full text-left px-3 py-2 rounded-md text-sm font-medium flex items-center space-x-2 ${
                  currentPage === item.id
                    ? 'bg-blue-100 text-blue-700'
                    : 'text-gray-600 hover:text-gray-900 hover:bg-gray-100'
                }`}
              >
                <Icon size={16} />
                <span>{item.label}</span>
              </button>
            );
          })}
        </div>
      </div>
    </nav>
  );
};

// Page Dashboard
const Dashboard = () => (
  <div className="p-6">
    <h2 className="text-2xl font-bold text-gray-800 mb-6">Dashboard</h2>
    <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
      <div className="bg-white p-6 rounded-lg shadow">
        <h3 className="text-lg font-semibold text-gray-700">Commandes du jour</h3>
        <p className="text-3xl font-bold text-blue-600 mt-2">24</p>
      </div>
      <div className="bg-white p-6 rounded-lg shadow">
        <h3 className="text-lg font-semibold text-gray-700">Revenus</h3>
        <p className="text-3xl font-bold text-green-600 mt-2">€1,250</p>
      </div>
      <div className="bg-white p-6 rounded-lg shadow">
        <h3 className="text-lg font-semibold text-gray-700">Clients actifs</h3>
        <p className="text-3xl font-bold text-purple-600 mt-2">156</p>
      </div>
      <div className="bg-white p-6 rounded-lg shadow">
        <h3 className="text-lg font-semibold text-gray-700">Stock faible</h3>
        <p className="text-3xl font-bold text-red-600 mt-2">8</p>
      </div>
    </div>
  </div>
);

// Page Abonnements
const Abonnements = () => (
  <div className="p-6">
    <h2 className="text-2xl font-bold text-gray-800 mb-6">Gestion des Abonnements</h2>
    <div className="bg-white rounded-lg shadow p-6">
      <div className="flex justify-between items-center mb-4">
        <h3 className="text-lg font-semibold">Abonnements actifs</h3>
        <button className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600">
          Nouvel abonnement
        </button>
      </div>
      <div className="overflow-x-auto">
        <table className="min-w-full divide-y divide-gray-200">
          <thead className="bg-gray-50">
            <tr>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Client</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Plan</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Statut</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Prochaine livraison</th>
            </tr>
          </thead>
          <tbody className="divide-y divide-gray-200">
            <tr>
              <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">Marie Dupont</td>
              <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">Premium</td>
              <td className="px-6 py-4 whitespace-nowrap">
                <span className="px-2 py-1 text-xs font-semibold rounded-full bg-green-100 text-green-800">Actif</span>
              </td>
              <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">25/06/2025</td>
            </tr>
          </tbody>
        </table>
      </div>
    </div>
  </div>
);

// Page Stocks
const Stocks = () => (
  <div className="p-6">
    <h2 className="text-2xl font-bold text-gray-800 mb-6">Gestion des Stocks</h2>
    <div className="bg-white rounded-lg shadow p-6">
      <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
        <div className="lg:col-span-2">
          <h3 className="text-lg font-semibold mb-4">Inventaire</h3>
          <div className="space-y-3">
            {['Tomates', 'Oignons', 'Carottes', 'Pommes de terre'].map((item, index) => (
              <div key={item} className="flex justify-between items-center p-3 border rounded">
                <span className="font-medium">{item}</span>
                <div className="flex items-center space-x-3">
                  <span className={`px-2 py-1 text-xs rounded ${index === 3 ? 'bg-red-100 text-red-800' : 'bg-green-100 text-green-800'}`}>
                    {index === 3 ? 'Stock faible' : 'En stock'}
                  </span>
                  <span className="text-gray-600">{20 - index * 3} kg</span>
                </div>
              </div>
            ))}
          </div>
        </div>
        <div>
          <h3 className="text-lg font-semibold mb-4">Actions rapides</h3>
          <div className="space-y-2">
            <button className="w-full bg-blue-500 text-white p-2 rounded hover:bg-blue-600">Ajouter stock</button>
            <button className="w-full bg-gray-500 text-white p-2 rounded hover:bg-gray-600">Rapport stock</button>
          </div>
        </div>
      </div>
    </div>
  </div>
);

// Pages simples pour les autres sections
const SimplePage = ({ title, description }) => (
  <div className="p-6">
    <h2 className="text-2xl font-bold text-gray-800 mb-6">{title}</h2>
    <div className="bg-white rounded-lg shadow p-6">
      <p className="text-gray-600">{description}</p>
      <div className="mt-6 p-4 bg-blue-50 rounded">
        <p className="text-blue-800">Cette section est en cours de développement.</p>
      </div>
    </div>
  </div>
);

// Composant principal App
const App = () => {
  const [currentPage, setCurrentPage] = useState('dashboard');

  const renderPage = () => {
    switch (currentPage) {
      case 'dashboard':
        return <Dashboard />;
      case 'abonnements':
        return <Abonnements />;
      case 'stocks':
        return <Stocks />;
      case 'commandes':
        return <SimplePage title="Gestion des Commandes" description="Gérez toutes vos commandes en cours et historiques." />;
      case 'clients':
        return <SimplePage title="Gestion des Clients" description="Base de données clients et informations personnelles." />;
      case 'menu':
        return <SimplePage title="Gestion du Menu" description="Créez et modifiez vos menus et plats." />;
      case 'livraisons':
        return <SimplePage title="Gestion des Livraisons" description="Planifiez et suivez vos livraisons." />;
      case 'facturation':
        return <SimplePage title="Facturation" description="Gérez vos factures et paiements." />;
      case 'kitchen':
        return <SimplePage title="Gestion de Cuisine" description="Organisez la production en cuisine." />;
      case 'ingredients':
        return <SimplePage title="Gestion des Ingrédients" description="Base de données des ingrédients disponibles." />;
      case 'statistics':
        return <SimplePage title="Statistiques" description="Analysez vos performances et tendances." />;
      case 'settings':
        return <SimplePage title="Paramètres" description="Configuration de l'application." />;
      default:
        return <Dashboard />;
    }
  };

  return (
    <div className="min-h-screen bg-gray-100">
      <AdminNavbar currentPage={currentPage} onNavigate={setCurrentPage} />
      <main>
        {renderPage()}
      </main>
    </div>
  );
};

export default App;
